    const {register, handleSubmit,formState: { errors }} = useForm() 
    const onSubmit = (data) => {
        //setUserinfo(data )
        console.log(data)
    }
    return(
        <div>
        <h2>Form with form-hook library</h2>

        <form onSubmit={handleSubmit(onSubmit)}>
            <div>
            <label>username: </label>
            <input type="text" name="username" placeholder="username" {...register("username")}></input>
            </div>
            <div>
            <label>email: </label>
            <input type="text" name="email" placeholder="email" {...register("email")}></input>
            </div>
            <div>
            <label>password: </label>
            <input type="password" name="password" placeholder="password" {...register("password")}></input>
            </div>
            <button type="button">Register</button>
        </form>
        </div>
    )
}
export default Formwithhook;
